import React, { Component } from "react";
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';
import { Redirect } from 'react-router-dom';
import { Link } from 'react-router-dom';

import SellerSignUp from "../Component/SellerSignUp"
import BuyerSignUp from "../Component/BuyerSignUp"

class SignUp extends Component {
    // postLogins = function () {
    //     this.props.postLogin().then(
    //         () => {
    //             this.props.history.push("/profile");
    //         }
    //     )
    // };

    render() {
        return (
            <section>
                <div class="container-fluid">
                    <div class="row">
                        <div class="col-12 col-md-3"></div>
                        <div class="col-12 col-md-6">

                            <div class="card box-signup my-5">
                                <ul class="nav nav-pills" style={{ fontSize: "18px" }}>
                                    <li class="active mx-4 p-2 blue-btn"><a data-toggle="pill" href="#buyer">Buyer</a></li>
                                    <li class="mx-4 p-2 blue-btn"><a data-toggle="pill" href="#seller">Seller</a></li>
                                </ul>
                                <hr />
                                <div class="tab-content">
                                    <div id="buyer" class="tab-pane active">
                                    <BuyerSignUp/>
                                    </div>
                                    <div id="seller" class="tab-pane fade">
                                    <SellerSignUp/>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="col-12 col-md-3"></div>
                    </div>
                </div>
            </section>
        );
    }
}

export default withRouter(SignUp);
